package com.lazooo.wifi.android.application;

import android.content.Context;
import android.view.View;
import android.view.ViewGroup;
import android.widget.BaseAdapter;
import android.widget.ImageView;
import com.nostra13.universalimageloader.core.ImageLoader;

public class ImageAdapter extends BaseAdapter {

    private Context context;

    ImageAdapter(Context context) {
        this.context = context;
    }

    public int getCount() {
        return mThumbIds.length;
    }

    public Object getItem(int position) {
        return null;
    }

    public long getItemId(int position) {
        return 0;
    }

    public View getView(int position, View convertView, ViewGroup parent) {
        ImageView imageView;
        if (convertView == null) {
            imageView = new ImageView(context);
            imageView.setScaleType(ImageView.ScaleType.CENTER_CROP);

        } else {
            imageView = (ImageView) convertView;
        }

        ImageLoader.getInstance().displayImage(mThumbIds[position], imageView);
        return imageView;
    }

    private String[] mThumbIds = {
            "https://encrypted-tbn2.gstatic.com/images?q=tbn:ANd9GcSthK-vBlnXJwclZcg8JWtmIBmjNfT3m4pDw3ZU_MiaQXB4OxWT1b2fLYQ4",
            "https://encrypted-tbn1.gstatic.com/images?q=tbn:ANd9GcTySjpZ0So1G7qN-KWwFN6P3UkNJPVYps7mJd1U1SXzbqbmwYA6hHsHfWI6",
            "data:image/jpeg;base64,"
    };

}
